"use strict";var profil_data=[{name:"Achmad Tahir",ttl:"Sumatera Utara, 27 Juni 1924",wafat:"17 Agustus 2002",masa:"1983-1988",pencapaian:"\n            <p>Menetapkan bebas visa untuk 26 negara serta 9 bandara dan 7 pelabuhan laut sebagai pintu masuk wisatawan.</p>\n        ",icon:'<img src="assets/img/profil/icon-1.png" alt=""/>',pp:'<img src="assets/img/profil/1.png" alt=""/>',desc_en:'\n            <div>\n                <img src="assets/img/profil/achieve-1.png"/>\n                <div class="text-center" style="margin-bottom:31px"><small>KOMPAS/HELMI KODHYAT (HK)</small></div>\n            </div>\n            <p>\n                Achmad Tahir was an Indonesia military figure who was born in North Sumatera on 27 June 1924. After more than two decades serving in the military, he was appointed as the Indonesian Ambassador to France and Spain in 1973.\n            </p>\n            <p>\n                After returning to Indonesia, Achmad Tahir served as Secretary General for the Transportation Department (Now Transportation Ministry) in 1976. During that time, the Transportation Ministry was led by Emil Salim. Tourism was managed under the Department of Transportation, among other areas including transportation, post and telecommunication, search and rescue (SAR) as well as weather forecast.\n            </p>\n            <p>\n                In 1983, while assembling the Fourth Development Cabinet, President Soeharto decided to separate the work of tourism and post and telecommunication division from the Department of Transportation. Hence the Department of Tourism (now Tourism and Creative Economy Ministry), Post and Telecommunication was formed with Achmad Tahir becoming the minister.\n            </p>\n        ',desc:'\n        <div>\n            <img src="assets/img/profil/achieve-1.png"/>\n            <div class="text-center" style="margin-bottom:31px"><small>KOMPAS/HELMI KODHYAT (HK)</small></div>\n        </div>\n        <p>\n            Achmad Tahir merupakan sosok prajurit kelahiran Sumatra Utara, 27 Juni 1924. Setelah dua dekade lebih malang melintang di dunia militer, pada 1973 ia ditunjuk menjadi Duta Besar RI di Prancis dan Spanyol.\n        </p>\n\n        <p>\n            Sekembalinya di Tanah Air, Achmad Tahir menjabat sebagai Sekretaris Jenderal Departemen Perhubungan pada 1976. Kala itu jabatan Menteri Perhubungan diampu oleh Emil Salim. Kepariwisataan adalah salah satu hal yang diurus departemen tersebut – hal lainnya di antaranya perhubungan, angkutan, pos dan telekomunikasi, kegiatan SAR serta memantau cuaca.\n        </p>\n        \n        <p>\n            Tahun 1983, saat tengah menyusun Kabinet Pembangunan IV, Presiden Soeharto memutuskan untuk memisahkan urusan pariwisata dan postel dari urusan perhubungan. Maka dibentuklah Departemen Pariwisata, Pos dan Telekomunikasi, dengan Achmad Tahir diangkat sebagai menterinya.\n        </p>\n   '},{name:"Soesilo Soedarman",ttl:"Cilacap, 10 November 1928",wafat:"18 Desember 1997",masa:"1988-1993",pencapaian:"\n            <ul>\n                <li>\n                    Tahun 1989 memperkenalkan program kampanye pariwisata Sapta Pesona.\n                </li>\n                <li>\n                    Pemerintah mengesahkan\n                    Undang-undang No. 9 Tahun 1990\n                    tentang kepariwisataan.\n                </li>\n                <li>\n                    Mencanangkan program\n                    Visit Indonesia Year 1991\n                </li>\n                <li>\n                    Pesona mulai dibangun\n                    Pada 1991 pula Gedung Sapta\n                </li>\n            </ul>\n        ",icon:'<img src="assets/img/profil/icon-2.png" alt=""/>',pp:'<img src="assets/img/profil/2.png" alt=""/>',desc_en:'\n        <div>\n            <img src="assets/img/profil/achieve-2.png"/>\n            <div class="text-center" style="margin-bottom:31px"><small>KOMPAS/DUDY SUDIBYO (DS)</small></div>\n        </div>\n        <p>\n            Soesilo Soedarman is known as a figure who loved Indonesian culture. He showed a deep love for wayang (Indonesian shadow puppet performance). Bima and Hanoman were his favorite wayang characters (from the play “Ramayana”).\n        </p>\n        <p>\n            “Mister Soedarman”, as he was affectionately called, played an important role in spreading and promoting Javanese culture. He had a set of gamelan instrument from the family of Kiai Manis and dozens of wayang kulit from the 18th century as his collection.\n        </p>\n        <p>\n            Aside from being the Minister of Tourism and Post Telecommunication, Soedarman, who was born on 10 November 1928, have also served as the Coordinating Political, Legal, and Security Affairs Minister. He also served as the Indonesian Ambassador to The United States of America.\n        </p>\n        <p>\n            In his hometown in Cilacap, Central Java, a museum has been named after Soesilo Soedarman. In this museum, people can find his collection of gamelan instrument and wayang, among his other personal mementos as an Indonesian Military (TNI) general.\n        </p>\n        ',desc:'\n        <div>\n            <img src="assets/img/profil/achieve-2.png"/>\n            <div class="text-center" style="margin-bottom:31px"><small>KOMPAS/DUDY SUDIBYO (DS)</small></div>\n        </div>\n        <p>\n            Sosoknya dikenal sebagai pribadi yang mencintai kebudayaan Indonesia. Ia bahkan pecinta  berat wayang. Tokoh pewayangan favorit pria yang akrab dipanggil Mr. Soedarman ini adalah  Bima dan Hanoman. \n        </p>\n\n        <p>\n            Soesilo juga berperan dalam pelestarian adat dan kebudayaan Jawa. Ia memiliki seperangkat gamelan milik keluarga Kiai Manis dan puluhan wayang kulit yang dibuat sekitar abad ke-18.\n        </p>\n\n        <p>\n            Selain sebagai Menteri Parpostel, sosok pria kelahiran 10 November 1028 ini juga sempat  menjabat sebagai Menteri Koordinator bidang Politik, Hukum dan Keamanan dan Duta Besar  RI untuk Amerika Serikat. \n        </p>\n\n        <p>\n            Namanya kini abadi sebagai nama sebuah museum di tanah kelahirannya, Cilacap, Jawa  Tengah. Di sana lah koleksi gamelan dan wayang Soesilo disimpan, di antara koleksi lain dari  kiprah Soesilo sebagai seorang jenderal.\n        </p>\n   '},{name:"Joop Ave",ttl:"Yogyakarta, 5 Desember 1934",wafat:"5 Februari 2014",masa:"1993-1998",pencapaian:"\n            <ul>\n                <li>\n                Dikenal sebagai Bapak Pariwisata Indonesia Giat mendorong pengembanganindustri Meeting, Incentive, Conference dan Exhibition (MICE)\n                </li>\n                <li>\n                    Pemerintah mengesahkan Undang-undang No. 9 Tahun 1990 tentang kepariwisataan.\n                </li>\n                \n            </ul>\n        ",icon:'<img src="assets/img/profil/icon-3.png" alt=""/>',pp:'<img src="assets/img/profil/3.png" alt=""/>',desc_en:'\n        <div>\n            <img src="assets/img/profil/achieve-3.png"/>\n            <div class="text-center" style="margin-bottom:31px"><small>KOMPAS/RAKA SANTERI (SARI)</small></div>\n        </div>\n        <p>\n            Born in Yogyakarta on 5 December 1934, Joop Ave is known as the “Father of Indonesian Tourism”, thanks to his years of dedication in developing Indonesian tourism. The Dutch descent, Joop Ave, mastered of four languages: English, Dutch, French and German.\n        </p>\n        <p>\n            His career as a state official started in 1957 when he worked in the Department of Foreign Affairs. In 1967, he worked in the Indonesian Consulate General in New York. Upon to his return to Indonesia, Joop Ave became the Head of Presidential Palace in 1972, Director General of Protocol and Consular Department of Foreign Affairs in 1978, and Director General of Tourism in 1982.\n        </p>\n        <p>\n            Throughout his service, his friendly behavior made him loved by a lot of people. He was able to keep his position as the Head of the Presidential Palace since the era of President Sukarno until the era of President Soeharto. Presidential guests such as Queen Elizabeth II and Prime Minister of the United Kingdom Margaret Thatcher along with her husband Denis Thatcher were all satisfied with Joop’s hospitality hospitality during their visit in the palace.\n        </p>\n        ',desc:'\n        <div>\n            <img src="assets/img/profil/achieve-3.png"/>\n            <div class="text-center" style="margin-bottom:31px"><small>KOMPAS/RAKA SANTERI (SARI)</small></div>\n        </div>\n        <p>\n            Lahir di Yogyakarta, 5 Desember 1934, Joop Ave dikenal sebagai “Bapak Pariwisata Indonesia”  berkat kiprahnya belasan tahun membangun kepariwisataan Indonesia. Pria berdarah  Belanda ini fasih dalam empat bahasa asing, yakni bahasa Inggris, Belanda, Prancis dan  Jerman.\n        </p>\n  \n        <p>\n            Kariernya di pemerintahan dimulai pada 1957 saat ia bekerja di Departemen Luar Negeri.  Tahun 1967, ia bekerja di Konsulat Jenderal RI di New York. Sekembalinya ke Indonesia, Joop  Ave menjadi Kepala Istana Kepresidenan tahun 1972, Direktur Jenderal Protokol dan Konsuler  Departemen Luar Negeri tahun 1978 dan Direktur Jenderal Pariwisata taun 1982. \n        </p>\n\n        <p>\n            Sepanjang kiprahnya sebagai pejabat negara, pribadi Joop Ave yang menyenangkan berhasil  membuat banyak tokoh terkesan padanya. Begitu mengesankan hingga ia mampu  mempertahankan posisi protokoler dan kepala rumah tangga Istana sejak zaman Presiden  Sukarno hingga Presiden Soeharto. Tamu-tamu kenegaraan, seperti Ratu Elizabeth II dan  suami Perdana Menteri Inggris Margaret Thatcher, Denis Thatcher, juga dikabarkan puas  dengan jamuan yang disajikan Joop di Istana.\n        </p>\n   '},{name:"Abdul Latief",ttl:"Banda Aceh, 27 April 1940",wafat:"",masa:"1998-1998",pencapaian:"\n            <p>Menjabat selama tiga bulan di tahun 1998 </p>\n        ",icon:"",pp:'<img src="assets/img/profil/4.png" alt=""/>',desc_en:"\n        <p>\n            Before serving as Minister of Tourism, Arts and Culture in the Seventh Development Cabinet in 1998, Abdul Latief was Manpower Minister in the previous cabinet\n        </p>\n        <p>\n            Outside the government, Abdul Latief is a successful businessman that established the network of Pasaraya shopping center. Abdul Latief, who was born in Banda Aceh, 27 April 1940, spread his business to media industry in 2001 by creating television channel Lativi – which now has different owner and has its name changed to TVOne.\n        </p>\n        <p>\n            Until the age of 80, under ALatief Corporaiton and with the help of his children, he managed multisector businesses from agribusiness, hotels, insurance, construction to advertisement.\n        </p>\n        ",desc:"\n        <p>\n            Sebelum menjabat sebagai Menteri Pariwisata, Seni dan Budaya di Kabinet Pembangunan VII  tahun 1998, Abdul Latief adalah Menteri Tenaga Kerja di kabinet sebelumnya.\n        </p>\n\n        <p>\n            Di luar pemerintahan, Abdul Latief merupakan seorang pebisnis sukses yang mendirikan  jaringan pusat perbelanjaan Pasaraya. Pada 2001, pria kelahiran Banda Aceh, 27 April 1940 ini  merambah bisnis media dengan mendirikan Lativi – yang sekarang sudah berganti kepemilikan  dan berubah nama menjadi TVOne. \n        </p>\n\n        <p>\n            Hingga usianya yang ke-80, di bawah ALatief Corporation, ia dengan dibantu oleh anak  anaknya mengelola bisnis di berbagai bidang, mulai dari agrobisnis, hotel, asuransi,  konstruksi, hingga periklanan. \n        </p>\n   "},{name:"Marzuki Usman",ttl:"Jambi, 30 Desember 1943",wafat:"",masa:"1998-1999",pencapaian:"\n            <p>Meski menjabat kurang dari satu tahun, sektor pariwisata Indonesia kala itu tumbuh dengan jumlah kunjungan wisatawan asing dari 4,6 juta orang menjadi 4,7 juta orang</p>\n        ",icon:'<img src="assets/img/profil/icon-5.png" alt=""/>',pp:'<img src="assets/img/profil/5.png" alt=""/>',desc_en:"\n        <p>\n            After earning title as bachelor of economic from Gadjah Mada University in 1969, Marzuki Usman began his career as a state official in the Directorate General of Finance, in the Department of Finance. He managed to climb up the career ladder until in the 1990s he chaired prominent positions in the department, including chaired the Indonesian Economic Scholars Association.\n        </p>\n        <p>\n            Marzuki was born on 30 December 1943 in Jambi. During the administration of President B. J. Habibie in the Development Reform Cabinet, Marzuki was trusted to become the Minister of Tourism, Arts and Culture. In 1999, he became the Head of Investment Coordinating Board (BKPM). During Abdurrahman Wahid’s presidency, he filled the position of Ministry of Forestry in the National Unity Cabinet\n        </p>\n        <p>\n            Outside his career in the government, Marzuki was also a well-known academician and a leader in various companies. As an economic expert, he was appointed as senior advisor in the Indonesian Stock Exchange for life. He had published various books about finance, tourism, and development\n        </p>\n\n        ",desc:"\n        <p>\n            Setelah meraih gelar sarjana ekonomi dari Universitas Gadjah Mada pada 1969, kariernya di  bidang pemerintahan dimulai sebagai Staf Direktorat Jenderal Keuangan di Departemen  Keuangan. Tangga karier ia tapaki satu persatu, sampai tahun 1990-an ia sudah menduduki  jabatan penting di departemen tersebut hingga mengetuai Ikatan Sarjana Ekonomi. \n        </p>\n\n        <p>\n            Di masa pemerintahan Presiden B.J. Habibie di kabinet Reformasi Pembangunan, pria  kelahiran Jambi, 30 Desember 1943 ini dipercaya menjabat sebagai Menteri Pariwisata, Seni  dan Budaya. Di tahun 1999, ia juga menjadi Menteri Negara Investasi atau Kepala Badan  Koordinasi Penanaman Modal (BKPM). Ia pun sempat mengisi posisi Menteri Kehutanan di  Kabinet Persatuan Nasional di bawah Presiden Abdurrahman Wahid. \n        </p>\n\n        <p>\n            Di luar pemerintahan, Marzuki Usman juga dikenal sebagai akademisi dan pimpinan di  berbagai perusahaan. Sebagai ekonom ulung, ia juga merupakan Penasehat Senior Bursa Efek  Indonesia seumur hidup. Ia juga telah menerbitkan banyak buku tentang keuangan,  pariwisata dan pembangunan.\n        </p>\n   "},{name:"Giri Suseno Hadihardjono ",ttl:"Solo, 5 Januari 1941",wafat:"27 Juni 2012",masa:"(ad-interim) 1999-1999",pencapaian:"",icon:"",pp:'<img src="assets/img/profil/6.png" alt=""/>',desc_en:'\n        <div>\n            <img src="assets/img/profil/achieve-6.png"/>\n            <div class="text-center" style="margin-bottom:31px"><small>KOMPAS/GUNAWAN SETIADI (GST)</small></div>\n        </div>\n        <p>\n            Giri Suseno served as a Minister of Tourism, Arts and Culture for one month from September until October 1999, while simultaneously serving as the Minister of Transportation.\n        </p>\n        <p>\n            After completing his service as a state official, Giri Suseno became a commissioner or an advisor for a number of private companies in the construction or industry sector.\n        </p>\n        <p>\n            Born in Solo, 5 January 1941, Giri Suseno earned his bachelor degree in the Bandung Institute of Technology (ITB) in 1984, master degree in the University of Michigan in 1966 and doctoral degree in ITB in 2005\n        </p>\n        ',desc:'\n        <div>\n            <img src="assets/img/profil/achieve-6.png"/>\n            <div class="text-center" style="margin-bottom:31px"><small>KOMPAS/GUNAWAN SETIADI (GST)</small></div>\n        </div>\n        <p>\n            Giri Suseno menjabat posisi Menteri Pariwisata, Seni dan Budaya selama sebulan, tepatnya  dari September sampai Oktober 1999, ketika dirinya masih berperan pula sebagai Menteri  Perhubungan. \n        </p>\n\n        <p>\n            Lepas dari kariernya di pemerintahan, Giri Suseno lebih banyak mengampu jabatan sebagai  komisaris atau penasehat sejumlah perusahaan swasta, yang beberapa di antaranya bergerak  di bidang konstruksi dan industri. \n        </p>\n\n        <p>\n            Lahir di Solo, 5 Januari 1941, Giri Suseno meraih gelar sarjana di Institut Teknologi Bandung  tahun 1984, master di University of Michigan tahun 1966 dan doktor di ITB pada 2005.\n        </p>\n        '},{name:"Hidayat Jaelani",ttl:"Padalarang, 16 Juni 1942",wafat:"",masa:"1999-2000",pencapaian:"\n        <ul>\n            <li>\n                Sebelum Hidayat dilantik, jabatan ini diduduki oleh Giri Suseno Hadihardjono sebagai Menteri ad interim selama sebulan di tahun 1999.\n            </li>\n            <li>\n                Di bawah kepemimpinannya, jumlah turis mancanegara yang datang ke Indonesia tumbuh menjadi 5 juta orang di tahun 2000.\n            </li>\n        </ul>\n        ",icon:'<img src="assets/img/profil/icon-7.png" alt=""/>',pp:'<img src="assets/img/profil/7.png" alt=""/>',desc_en:"\n        <p>\n            When President Abdurrahman Wahid forming his National Unity Cabinet, Hidayat Jaelani was appointed as the Minister of Tourism and Arts. He was in this position for only one year, from October 1999 to August 2000. Hidayat was a Padjajaran University alumnus.\n        </p>\n        ",desc:"\n            <p>Saat Presiden Abdurrahman Wahid menyusun Kabinet Persatuan Nasional, Hidayat Jaelani  ditunjuk sebagai Menteri Negara Pariwisata dan Kesenian. Jabatan tersebut hanya dijalani  oleh lulusan Universitas Padjadjaran Bandung ini selama satu tahun, dari Oktober 1999 hingga  Agustus 2000.</p>\n        "},{name:"I Gede Ardhika",ttl:"Singaraja, 15 Februari 1945",wafat:"",masa:"2000-2004",pencapaian:"\n        <ul>\n            <li>\n                Menjabat sejak 2000 sampai tahun2004 di bawah dua presiden, yakni Abdurrahman Wahid dan Megawati Soekarnoputri.\n            </li>\n            <li>\n                Jumlah wisatawan asing tahun 2002 sebanyak 5 juta orang, merosot menjadi 4,4 juta orang di tahun 2003.\n            </li>\n            <li>\n                Namun demikian, angka ini meningkatkembali ke 5 juta di akhir tahun 2004 dengan pendapatan negara daridevisa sebanyak US$ 4 miliar\n            </li>\n        </ul>\n        ",icon:'<img src="assets/img/profil/icon-8.png" alt=""/>',pp:'<img src="assets/img/profil/8.png" alt=""/>',desc_en:"\n        <p>\n            I Gede Ardhika served as Minister of Culture and Tourism for two cabinets, namely the National Unity Cabinet under President Abdurrahman Wahid from 2000 until 2001 and the Mutual Assistance Cabinet under President Megawati Soekarnoputri from 2001 until 2004\n        </p>\n        <p>\n            I Gede Ardhika was born in Singaraja, 15 February 1945. In his youth, he was once enrolled in the Faculty of Art at the Bandung Institute of Technology (ITB). However, due to financial constraints, he failed to complete his degree. Determined to pursue his dream to higher education, he switched to the Bandung Hospitality Academy. After finishing his study, he received a scholarship to pursue further studies in Switzerland.\n        </p>\n        <p>\n            Upon returning to Indonesia, he was appointed as the Chief of Sub-Directorate of Hotels and Lodging in the Directorate General of Tourism. His career in the department continued until he was promoted to be the minister in 2000.\n        </p>\n        ",desc:"\n        <p>\n            I Gede Ardhika menjalankan peran sebagai Menteri Kebudayaan dan Pariwisata untuk dua  kabinet, yakni Kabinet Persatuan Nasional di bawah Presiden Abdurrahman Wahid sejak 2000 hingga 2001 dan Kabinet Gotong Royong di bawah Presiden Megawati Soekarnoputri dari  2001 sampai 2004. \n        </p>\n\n        <p>\n            Di masa mudanya, I Gede Ardhika sempat menempuh Pendidikan tinggi di Fakultas Seni Rupa  Institut Teknologi Bandung, namun terhenti karena kendala ekonomi. Tak menyerah pada  keadaan, pria yang lahir di Singaraja, 15 Februari 1945 ini berpindah ke Akademi Perhotelan  Bandung. Usai mendapat gelar sarjana, ia mendapat beasiswa untuk melanjutkan studi ke  Swiss. \n        </p>\n        \n        <p>\n            Sepulang studi di Swiss, ia dipercaya sebagai pelaksana harian Kepala Sub-Direktorat  Perhotelan dan Penginapan di Direktorat Jenderal Pariwisata. Kariernya di departemen  tersebut berlanjut hingga ia diangkat sebagai menteri di tahun 2000.\n        </p>\n        "},{name:"Jero Wacik",ttl:"Singaraja, 24 April 1949",wafat:"",masa:"2004-2009, 2009-2011",pencapaian:"\n        <ul>\n            <li>\n                Pariwisata Indonesia kembalimengalami krisis di tahun 2005 setelah peristiwa Bom Bali II Tahun 2008, program Visit Indonesia Year dihidupkan lagi\n            </li> \n            <li>\n                Pada 2009, sebelum menjabat untuk periode kedua, posisi Menpar sempat dijabat oleh Muhammad Nuh sebagai menteri ad interim\n            </li> \n            <li>\n                Tahun 2011, pemerintah mencanangkan program kampanye pariwisata Wonderful Indonesia\n            </li>\n        </ul>\n        ",icon:'<img src="assets/img/profil/icon-9.png" alt=""/>',pp:'<img src="assets/img/profil/9.png" alt=""/>',desc_en:"\n        <p>\n            Jero Wacik has bachelor degrees from two universities, the Bandung Institute of Technology (ITB) and the University of Indonesia. Jero Wacik who was born in Singaraja, 24 April 1949 is a hardworking person with a broad of interests.\n        </p>\n        <p>\n            Since his university days, he had worked with a number of textile companies in Bandung and worked as an assistant in the university department. He also had experiences working in the automotive industry. Today, he runs multiple business in the hospitality, tourism, textile as well as interior design sectors based in Jakarta and Bali.\n        </p>\n        <p>\n            The year of 2004 was a monumental period for Jero Wacik. One day that year, he was summoned by President Susilo Bambang Yudhoyono. In a meeting that only lasted 8 minutes, the president asked him questions about tourism and culture. His answers impressed the president and, long story short, Jero Wacik was appointed to be the Minister of Tourism in the First United Indonesia Cabinet. His career as a minister continued to the Second United Indonesia Cabinet. In 2011, he was trusted to lead the Ministry of Energy and Mineral Resources during a cabinet reshuffle.\n        </p>\n\n        ",desc:"\n        <p>\n            Jero Wacik menyandang gelar sarjana dari dua perguruan tinggi, yakni dari Institut Teknologi  Bandung dan Fakultas Ekonomi Universitas Indonesia. Pria kelahiran Singaraja, 24 April 1949  ini merupakan sosok pekerja keras yang memiliki beragam minat. \n        </p>\n\n        <p>\n            Bahkan sejak masih di bangku kuliah, ia menjalani pendidikan sambil bekerja di sejumlah  perusahaan tekstil di Bandung sebagai tim peneliti sekaligus sebagai asisten jurusan di ITB. Ia  pernah bekerja di perusahaan industri otomotif, namun kini sudah menjalankan perusahaan  yang bergerak di bidang perhotelan, biro perjalanan wisata, interior dan desain tekstil yang  berlokasi di Jakarta dan Bali. \n        </p>\n        \n        <p>\n            Tahun 2004 menjadi tahun bersejarah bagi Jero Wacik, ketika ia dipanggil oleh Presiden Susilo  Bambang Yudhoyono. Ia mengaku, dalam pertemuan sekitar delapan menit, ia banyak  ditanyai seputar pariwisata dan budaya oleh SBY. Singkat cerita, dilantiklah ia menjadi Menteri  Pariwisata di Kabinet Indonesia Bersatu, bahkan hingga Kabinet Indonesia Bersatu II. Tahun  2011, saat reshuffle kabinet, Jero Wacik dipindahtugaskan mengepalai Kementerian Energi  dan Sumber Daya Mineral.\n        </p>\n        "},{name:"Mohammad Nuh",ttl:"",wafat:"",masa:"(ad-interim) 2009-2009",pencapaian:"",icon:"",pp:'<img src="assets/img/profil/10.png" alt=""/>',desc_en:"\n        <p>\n            Mohammad Nuh chaired the Ministry of Culture and Tourism for 20 days, from 1 October until 20 October 2009. However, his career as a minister under President Susilo Bambang Yudhoyono (SBY) was more than that.\n        </p>\n        <p>\n            In the United Indonesia Cabinet, Mohammad Nuh served as Minister of Communication and Informatics from 2007 to 2009. During President SBY’s second term, Mohammad Nuh was trusted to lead the Ministry of Education and Culture.\n        </p>\n        <p>\n            Before being involved in the government, Mohammad Nuh, who was born in Surabaya, 17 June 1959, was an academician who graduated and teach at the Sepuluh Nopember Institute of Technology (ITS) in Surabaya. He also once served as a rector at ITS\n        </p>\n\n        ",desc:"\n        <p>\n            Mohammad Nuh mengepalai Kementerian Kebudayaan dan Pariwisata hanya selama 20 hari,  yakni sejak 1 Oktober hingga 20 Oktober 2009. Namun demikian, kariernya sebagai seorang  menteri di bawah Presiden Susilo Bambang Yudhoyono lebih dari itu. \n        </p>\n\n        <p>\n            Di Kabinet Indonesia Bersatu, tepatnya sejak 2007 hingga 2009, Mohammad Nuh adalah  Menteri Komunikasi dan Informatika. Saat Presiden SBY dilantik untuk periode kedua dan membentuk Kabinet Indonesia Bersatu II, pria asal Surabaya kelahiran 17 Juni 1959 ini diangkat menjadi Menteri Pendidikan dan Kebudayaan. \n        </p>\n        \n        <p>\n            Sebelum sibuk di dunia pemerintahan, ia adalah akademisi yang lulus, mengajar serta sempat  menjadi rektor di Institut Teknologi Sepuluh Nopember Surabaya. \n        </p>\n        "},{name:"Mari Elka Pangestu",ttl:"Jakarta, 23 Oktober 1956",wafat:"",masa:"2011-2014",pencapaian:"\n        <ul>\n            <li>\n                Menteri perempuan pertama di Kementerian Pariwisata danEkonomi Kreatif \n                Menjabat sejak tahun 2001 hingga 2004 \n            </li>\n            <li>\n                Selama tiga tahun ia menjabat,jumlah wisatawan mancanegara yang berkunjung ke Indonesia tumbuh dari 7,6 juta orang menjadi 8 juta orang dan 8,8 juta orang \n            </li>\n            <li>\n                Devisa negara dari sektor pariwisata pun meningkat dari US$ 8,5 miliar menjadi US$ 9,1 miliar dan US$ 10 miliar\n            </li>\n        </ul>\n        ",icon:'<img src="assets/img/profil/icon-11.png" alt=""/>',pp:'<img src="assets/img/profil/11.png" alt=""/>',desc_en:"\n        <p>\n            Mari Elka Pangestu began her career as a minister since 2004, when she was trusted as Minister of Trade in the First United Indonesia Cabinet under President Susilo Bambang Yudhoyono (SBY).\n        </p>\n        <p>\n            Prior to this, Mari, who was born in Jakarta, 23 October 1956, was known as an economist. Like an apple that doesn’t fall far from the tree, she is the daughter of a famous senior economist J. Panglaykim. Mari Elka, who graduated from the Australian National University and the University of California, used to work as a consultant for various international organisations.\n        </p>\n        <p>\n            She continued her work as a Minister of Trade when President SBY carried out his second presidential term. In 2011, during a cabinet reshuffle, Mari was asked to lead the Ministry of Tourism and Creative Industry. She is the first woman minister in the history of the ministry.\n        </p>\n        <p>\n            In 2013, President SBY awarded Mari the Bintang Mahaputera Adipradana Award for her service to the country.\n        </p>\n        <p>\n            In the beginning of 2020, she was appointed as the World Bank Managing Director of Development Policy and Partnerships. This prestigious position made her to be the second Indonesian woman in the World Bank.\n        </p>\n        ",desc:"\n        <p>\n            Karier Mari sebagai seorang menteri dimulai sejak tahun 2004, ketika dirinya dipercaya oleh  Presiden SBY untuk mengepalai Kementerian Perdagangan di Kabinet Indonesia Bersatu I.\n        </p>\n\n        <p>\n            Sebelumnya, Mari dikenal sebagai seorang ekonom. Bagaikan buah yang tak jauh dari  pohonnya, ia adalah putri dari ekonom senior terkenal J. Panglaykim. Lulusan Australian  National University dan University of California ini sempat menjadi konsultan bagi beragam  organisasi internasional. \n        </p>\n        \n        <p>\n            Ia meneruskan pekerjaannya sebagai Menteri Perdagangan saat Presiden SBY menjabat posisi  presiden untuk periode kedua. Pada 2011, saat reshuffle kabinet, Mari melanjutkan kariernya  sebagai menteri di Kementerian Pariwisata dan Ekonomi Kreatif. Jabatan ini sekaligus  menjadikannya sebagai menteri perempuan pertama sepanjang sejarah Kementerian  Pariwisata dan Ekonomi Kreatif.\n        </p>\n        \n        <p>\n            Tahun 2013, Presiden SBY memberikan Mari penghargaan Bintang Mahaputera Adipradana  atas pengabdiannya pada negara selama itu. \n        </p>\n        \n        <p>\n            Pada awal 2020, wanita kelahiran Jakarta, 23 Oktober 1956 ini resmi menjabat Direktur  Pelaksana, Kebijakan Pembangunan dan Kemitraan untuk Bank Dunia. Prestasi ini sekaligus menjadikannya sebagai perempuan kedua Indonesia di Bank Dunia.\n        </p>\n        "},{name:"Arief Yahya",ttl:"Banyuwangi, 2 April 1961",wafat:"",masa:"2014-2019",pencapaian:"\n        <ul>\n            <li>\n                Pemerintah memperkenalkan “10 Bali Baru” sebagai destinasi pariwisata utama \n                Indeks daya saing pariwisata Indonesia berdasarkan World Economic Forum meningkat dari peringkat 50 di tahun 2015, 42 tahun 2017 dan 40 tahun 2019\n            </li>\n            <li>\n                Tahun 2019, industri pariwisata Indonesia meraih 11penghargaan dari ajang ASEAN Tourism Award 2019\n            </li>\n            <li>\n                Sektor pariwisata menjadi salah satu penyumbang devisa terbesar dengan nilai US$ 12,2 miliar pada 2015,US$ 13,6 miliar tahun 2016 dan US$ 15 miliar tahun 2017\n            </li>\n        </ul>\n        ",icon:'<img src="assets/img/profil/icon-12.png" alt=""/>',pp:'<img src="assets/img/profil/12.png" alt=""/>',desc_en:"\n        <p>\n            Life experiences have shaped Arief Yahya as the man he is today. Born and raised in a modest family, he became a person with great leadership skill. He said he was inspired by his mother’s life philosophy who taught him to be diligent and modest.\n        </p>\n        <p>\n            Arief was born in Banyuwangi, 2 March 1961. After completing his studies at the Bandung Institute of Technology (ITB), Arief started his career in PT Telkom at the age of 25 years. He climbed up the career ladder until he was appointed as the President Director of PT Telkom in 2012\n        </p>\n        <p>\n            After only two years that position, he was asked by President Jokowi to be the Minister of Tourism. Although he spent 28 years of his career in the telecommunication sector, he was deemed successful in leading Indonesia’s tourism.\n        </p>       \n        <p>\n            In the mid of 2019, Arief was awarded as one of the high achieving ministers in the Working Cabinet 2014-2019. This was awarded by the Lembaga Kajian Nusantara (LKN) and the Ikatan Ahli Manajemen Proyek (IAMPI)\n        </p>\n        ",desc:"\n        <p>\n            Pengalaman hidup telah menempa Arief Yahya yang lahir dan tumbuh dari keluarga  sederhana menjadi sosok dengan jiwa kepemimpinan yang baik. Ia mengaku terinspirasi  filosofi hidup sang ibunda, yakni tekun dan sederhana. \n        </p>\n\n        <p>\n            Usai menamatkan studinya di ITB, Arief memulai karier di PT Telkom di usia 25 tahun. Anak  tangga karier ia tapaki satu demi satu hingga pada 2012 ia dilantik menjadi Direktur Utama  Telkom. \n        </p>\n        \n        <p>\n            Baru dua tahun menjabat, pria kelahiran Banyuwangi, 2 Maret 1961 ini diminta Presiden  Jokowi menjadi Menteri Pariwisata. Meski 28 tahun kehidupan kariernya ia habiskan di sektor telekomunikasi, ia dianggap mampu mengelola kepariwisataan Indonesia. \n        </p>\n        \n        <p>\n            Pertengahan 2019, Arief dinobatkan sebagai salah satu Menteri berprestasi tinggi dalam  Kabinet Kerja 2014-2019. Penghargaan ini diberikan oleh Lembaga Kajian Nusantara (LKN) dan  Ikatan Ahli Manajemen Proyek (IAMPI).\n        </p>\n        "},{name:"Wishnutama Kusubandio",ttl:"4 Mei 1970",wafat:"",masa:"2019-2024",pencapaian:"\n        <ul>\n            <li>\n                Memperkenalkan lima destinasi wisata prioritas di antaranya Danau Toba, Mandalika, Likupang, Borobudur dan Labuan Bajo \n            </li>\n            <li>\n                Industri pariwisata sempat mengalami krisis selama pandemi COVID-19 Kemenparekraf mencanangkan program Cleanliness, Health, Safety and Environmental Sustainability (CHSE)sebagai bentuk adaptasi pariwisata selama pandemic \n            </li>\n            <li>\n                Untuk mendorong geliat ekonomi kreatif, Kemenparekraf menjalankan gerakan #BeliKreatifLokal\n            </li>\n        </ul>\n        ",icon:'<img src="assets/img/profil/icon-13.png" alt=""/>',pp:'<img src="assets/img/profil/13.png" alt=""/>',desc_en:"\n        <p>\n            Before becoming Minister of Tourism and Creative Economy, Wishnutama was a famous figure in the national television industry. Since 1994, he has built up his career and gained experience from one television to the other.\n        </p>\n        <p>\n            His television career reached its peak when he became the director of Trans Corp. In 2012, he resigned to establish NET TV. In 2018, he was trusted to become the creative director for the opening and closing ceremonies of the Asian Games in Jakarta.\n        </p>\n        <p>\n            With the appointment of Wishnutama, who was born on 4 May 1970, to be the Minister of Tourism and Creative Economy, President Jokowi has expected that his creative ideas could boost the tourism and creative industry potentials in Indonesia. From initiating international scale events to promoting tourism through creative medium such as music and films.\n        </p>\n        ",desc:"\n        <p>\n            Sebelum menjadi Menteri Pariwisata, Wishnutama adalah sosok yang cukup tersohor di dunia  penyiaran televisi Tanah Air. Sejak 1994, ia sudah malang melintang meniti karier dari satu  stasiun televisi ke stasiun televisi lain. \n        </p>\n\n        <p>\n            Puncak karier Wishnutama di dunia tersebut adalah saat ia menjadi direktur utama Trans  Corp, kemudian mengundurkan diri pada 2012 untuk mendirikan NET pada 2013. Tahun 2018,  ia dipercaya untuk menjadi sutradara kreatif pada opening dan closing ceremony Asian Games di Jakarta. \n        </p>\n        \n        <p>\n            Dengan ditunjuknya pria kelahiran 4 Mei 1970 sebagai Menteri Pariwisata dan Ekonomi  Kreatif, Presiden Jokowi berharap ide-ide kreatif Wishnutama dapat mendongkrak potensi  pariwisata dan industri kreatif di Indonesia. Mulai dari membuat pergelaran berskala  internasional hingga mempromosikan pariwisata melalui produk ekonomi kreatif seperti  musik atau film.\n        </p>\n        "},{name:"Angela Tanoesoedibjo",jabatan:"Wakil Menteri Pariwisata dan Ekonomi Kreatif",pencapaian:"",pp:'<img src="assets/img/profil/14-modal.png" alt=""/>',desc_en:"\n    <p>\n        Before becoming Minister of Tourism and Creative Economy, Wishnutama was a famous figure in the national television industry. Since 1994, he has built up his career and gained experience from one television to the other.\n    </p>\n    <p>\n        His television career reached its peak when he became the director of Trans Corp. In 2012, he resigned to establish NET TV. In 2018, he was trusted to become the creative director for the opening and closing ceremonies of the Asian Games in Jakarta.\n    </p>\n    <p>\n        With the appointment of Wishnutama, who was born on 4 May 1970, to be the Minister of Tourism and Creative Economy, President Jokowi has expected that his creative ideas could boost the tourism and creative industry potentials in Indonesia. From initiating international scale events to promoting tourism through creative medium such as music and films.\n    </p>\n    ",desc:'\n    <p>\n    Angela Tanoesoedibjo mengawali karir di pemerintahan sejak 25 Oktober 2019, saat dilantik menjadi Wakil Menteri Pariwisata dan Ekonomi Kreatif (Menparekraf). Saat dilantik, Angela menjadi Wakil Menteri termuda di Kabinet Indonesia Maju, dalam usia 32 tahun.\n    </p>\n\n    <p>\n    Sebelumnya, Angela Tanoesoedibjo berkiprah di industri media, dengan mendirikan majalah HighEnd Magazine dan HighEnd Teen Magazine pada 2008. Karirnya kemudian merambah ke industri televisi, dengan bergabung di perusahaan media MNC Group sebagai staf keuangan pada 2010.\n    </p>\n\n    <div class="hardcode-image float-right">\n        <img src="assets/img/profil/14-modal.png" alt="">\n        <div class="hardcode-sumber">SUMBER: KEMENPAREKRAF</div>\n    </div>\n    \n    <p>\n    Angela Tanoesoedibjo kemudian dipercaya sebagai Managing Director Global TV pada 2014, dan membawa Global TV ke dalam daftar 5 besar stasiun televisi terestrial di Indonesia. Angela juga memimpin proses rebranding Global TV menjadi GTV pada 2017.</p>\n\n    <p>Angela Tanoesoedibjo lahir di Kanada, 23 April 1987 dan menyelesaikan pendidikan Sarjana dengan gelar Bachelor of Arts in Communications (Media Arts and Productions) dari University of Technology Sydney pada tahun 2008.</p>\n    \n    <p>Angela juga memiliki gelar Master of Commerce dalam bidang keuangan, yang diperolehnya dari University of New South Wales, Australian School of Business pada tahun 2010. Ia pun mengawali karirnya di industri media dan hiburan sejak 2008, sebagai Direktur PT MNI Entertainment.</p>\n    \n    <p>Sederet jabatan yang pernah diemban Angela Tanoesoedibjo, antara lain adalah sebagai berikut:\n    </p>\n\n    <table>\n        <tr>\n            <td><b>2010</b>:</td>\n            <td>Corporate Finance & Business Development Associate PT Media Nusantara Citra, TBK</td>\n        </tr>\n        <tr>\n            <td><b>2013</b>:</td>\n            <td>\n            Direktur PT Megah Group</td>\n        </tr>\n        <tr>\n            <td><b>2014</b>:</td>\n            <td>\n            Managing Director PT Global Informasi Bermutu yang membawahi Global TV/td>\n        </tr>\n        <tr>\n            <td><b>2016</b>:</td>\n            <td>\n            Direktur PT Media Nusantara Citra, Tbk./td>\n        </tr>\n        <tr>\n            <td><b>2018</b>:</td>\n            <td>\n            Managing Director PT. Rajawali Citra Televisi Indonesia (RCTI)\n            </td>\n        </tr>\n    </table>\n    <p>\n    Latar belakang Angela Tanoesoedibjo di bidang manajemen, media, retail, dan finance membuatnya dipercaya Presiden Joko Widodo sebagai sosok yang dapat mengembangkan industri pariwisata dan ekonomi kreatif, terutama untuk pengembangan 10 destinasi pariwisata baru.</p>\n    '},{name:"SAPTA NIRWANDAR",jabatan:"Wakil Menteri Pariwisata dan Ekonomi Kreatif (2011-2014)",pencapaian:"\n            <ul>\n                <li>Pegawai di salah satu bank asing</li>\n                <li>PNS di Badan Tenaga Atom Nasional (Batan)</li>\n                <li>Kementerian Negara Pendayagunaan</li>\n                <li>Aparatur Negara</li>\n                <li>Badan Pengendalian Dampak Lingkungan</li>\n                <li>Asisten Menteri bidang kelembagaan</li>\n                <li>Kementerian Negara Pendayagunaan</li>\n                <li>Aparatur Negara</li>\n                <li>Sekretaris Jenderal Departemen Kelautan</li>\n                <li>dan Perikanan</li>\n                <li>Sekretaris Departemen Pariwisata (2001-2004)</li>\n                <li>Sekretaris Jendral Departemen Budaya</li>\n                <li>dan Pariwisata</li>\n                <li>Direktur Jenderal Pemasaran Kementerian</li>\n                <li>Pariwisata dan Ekonomi Kreatif</li>\n                <li>Wakil Menteri Pariwisata dan Ekonomi Kreatif</li>\n            </ul>\n        ",pp:'<img src="assets/img/profil/14-modal.png" alt=""/>',desc_en:"\n    <p>\n        Before becoming Minister of Tourism and Creative Economy, Wishnutama was a famous figure in the national television industry. Since 1994, he has built up his career and gained experience from one television to the other.\n    </p>\n    <p>\n        His television career reached its peak when he became the director of Trans Corp. In 2012, he resigned to establish NET TV. In 2018, he was trusted to become the creative director for the opening and closing ceremonies of the Asian Games in Jakarta.\n    </p>\n    <p>\n        With the appointment of Wishnutama, who was born on 4 May 1970, to be the Minister of Tourism and Creative Economy, President Jokowi has expected that his creative ideas could boost the tourism and creative industry potentials in Indonesia. From initiating international scale events to promoting tourism through creative medium such as music and films.\n    </p>\n    ",desc:'\n    <p>\n    Mantan Menbudpar I Gede Ardika mengakui Sapta memiliki kemampuan menganalisis permasalahan secara cepat, punya kepribadian kuat, mudah beradaptasi dan memiliki keteguhan dan kemauan untuk mengerjakan pekerjaan secara lugas, tuntas dan cepat.\n    </p>\n    \n    <div class="hardcode-image float-right">\n        <img src="assets/img/profil/15-modall.png" alt="">\n        <div class="hardcode-sumber">SUMBER: BISNIS INDONESIA</div>\n    </div>\n    <p>\n    Tak heran di usia yang relatif muda, sebagai seorang pegawai negri sipil kariernya melesat hingga menjadi orang nomor dua di Depbudpar. Keistimewaan pria kelahiran Tanjung Karang, Lampung, 52 tahun lalu ini adalah, di manapun dia berada maka lingkungannya dengan cepat bisa melihat karya-karyanya.\n    </p>\n\n    \n    <p>\n    Karier Sapta Nirwandar dibangun seusai menyelesaikan pendidikan sarjana ekonomi di Universitas Padjadjaran Bandung pada 1978. Tamat kuliah, alumnus SMA VI jurusan paspal di Yogyakarta ini sempat berkarier di perbankan asing dengan gaji yang memadai sebelum memilih jadi PNS di Badan Tenaga Atom Nasional (Batan).</p>\n\n    \n    '}];
